// See Sound tab for info
void mainImage( out vec4 fragColor, in vec2 fragCoord ) {
    vec2 dim = vec2(240,303);
    vec2 uv = fragCoord/iResolution.xy;
    uv.y = 1.0-uv.y;
    uv.x -= 0.5;
    uv *= 303.0/iResolution.y;
    uv.x += 0.5*(240.0/iResolution.x);
    vec3 col = vec3(1,1,0.8);
    col *= texture(iChannel0,uv).xyz;
    // Output to screen
    fragColor = vec4(col,1.0);
}
